import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Electronics" link. We use .first() because there are multiple.
    const electronicsLink = page.getByRole('link', { name: 'Electronics' }).first();
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsLink.click();

    // Wait for the category page content to load
    await page.waitForSelector('div.category-results h2', { timeout: 5000 });

    // Take a screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract the category title to verify
    const categoryTitle = await page.locator('div.category-results h2').textContent();

    return {
      success: true,
      action: "Navigated to the Electronics category by clicking the link.",
      extractedData: {
        categoryTitle: categoryTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
